import React, {useEffect, useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import reactDom from 'react-dom';
import { Button } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';


function Square({value, onClick}){
  return (
      <Button className ="square" onClick={onClick} >
        {value}
      </Button>

  )
  }
function ConnectFourBoard ()
  {
    const[squares, setSquare] = useState(Array(42).fill(null));
    const [isYellowTurn, setYellowTurn] = useState(true);
    const winner = calculateWinner(squares);

    return(
      <div>
        <div>
        {renderSquare(0)}
        {renderSquare(1)}        
        {renderSquare(2)}
        {renderSquare(3)}        
        {renderSquare(4)}        
        {renderSquare(5)}        
        {renderSquare(6)}
      </div>
      <div>
        {renderSquare(7)}
        {renderSquare(8)}        
        {renderSquare(9)}
        {renderSquare(10)}        
        {renderSquare(11)}        
        {renderSquare(12)}        
        {renderSquare(13)}
      </div>
      <div>
        {renderSquare(14)}
        {renderSquare(15)}        
        {renderSquare(16)}
        {renderSquare(17)}        
        {renderSquare(18)}        
        {renderSquare(19)}        
        {renderSquare(20)}
      </div>
      <div>
        {renderSquare(21)}
        {renderSquare(22)}        
        {renderSquare(23)}
        {renderSquare(24)}        
        {renderSquare(25)}        
        {renderSquare(26)}        
        {renderSquare(27)}
      </div>
      <div>
        {renderSquare(28)}
        {renderSquare(29)}        
        {renderSquare(30)}
        {renderSquare(31)}        
        {renderSquare(32)}        
        {renderSquare(33)}        
        {renderSquare(34)}
      </div>
      <div>
        {renderSquare(35)}
        {renderSquare(36)}        
        {renderSquare(37)}
        {renderSquare(38)}        
        {renderSquare(39)}        
        {renderSquare(40)}        
        {renderSquare(41)}
      </div>
    <div>{getWinner()}</div>
      </div>
    )
    function renderSquare(input) {
      return(
        <Square value = {squares[input]} onClick={() =>{
          const tempSquares = squares.slice();
          if(tempSquares[input]===null && winner === null){
            tempSquares[input]= isYellowTurn? "X" : "O";
          setSquare(tempSquares);
          setYellowTurn(!isYellowTurn);
          }
        }}/>
      )
  }

  function getWinner(){
    if(winner) {
      return winner + " Won!"
    }
  }

  }



ReactDOM.render(
  <ConnectFourBoard/>,
  document.getElementById('root')
);

function calculateWinner(squares) {
  const winningSets = [
    [0,1,2,3],[1,2,3,4],[2,3,4,5],[3,4,5,6],
    [7,8,9,10],[8,9,10,11],[9,10,11,12],[10,11,12,13],
    [14,15,16,17],[15,16,17,18],[16,17,18,19],[17,18,19,20],
    [21,22,23,24],[22,23,24,25],[23,24,25,26],[24,25,26,27],
    [28,29,30,31],[29,30,31,32],[30,31,32,33],[31,32,33,34],
    [35,36,37,38],[36,37,38,39],[37,38,39,40],[38,39,40,41],
    [0,7,14,21],[7,14,21,28],[14,21,28,35],
    [1,8,15,22],[8,15,22,29],[15,22,29,36],
    [2,9,16,23],[9,16,23,30],[16,23,30,37],
    [3,10,17,24],[10,17,24,31],[17,24,31,38],
    [4,11,18,25],[11,18,25,32],[18,25,32,39],
    [5,12,19,26],[12,19,26,33],[19,26,33,40],
    [6,13,20,27],[13,20,27,34],[20,27,34,41]
  ];

  for (let i = 0; i < winningSets.length; i++){
    const [a, b, c, d] = winningSets[i];
    if(squares[a] === squares[b] && squares[a] === squares[c] && squares[a] === squares[d]){
      return squares[a];
    }
  }
  return null;
}

